sys_variable_value.value:
(function execute(inputs, outputs) {
    // Remove the hyphen from the input
    var cleanedCusip = inputs.cusip.replace('-', '');

    // Build the full query URL with a leading forward slash
    outputs.cusipsearch = '/cusip/search?q=cusip:' + cleanedCusip;
})(inputs, outputs);

